import React from "react";
import Header from "../components/header/Header";
import Footer from "../components/footer/Footer";
import KakaoMapResult from "../components/body/map/KakaoMapResult";
import { Button, BodyLayout } from "../components/body/mixin/Mixin";
import { Link } from "react-router-dom";
import PageSlider from "../components/body/mixin/PageSlider";

// 여기도 페이지 슬라이더 먹이자
const Result = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        {/* 요약 */}
        <div>
          <div>잠실역 데이트</div>
          <div>10:00~14:00</div>
          <div>잠실역</div>
        </div>
        <PageSlider>
          <div>소제목</div>
          <KakaoMapResult />
          <div>장소 소개</div>
        </PageSlider>
        <Button>다음</Button>
        <Button>이전</Button>
        <Link to={"/planning"}>
          <Button>다시 선택하기</Button>
        </Link>
        <Button>휴대폰 알람 설정하기</Button>
      </BodyLayout>
      <Footer />
    </>
  );
};

export default Result;
